package types

import (
	"bytes"
	"encoding/hex"
	"testing"
)

func TestVerifyMembershipABI(t *testing.T) {
	for _, tc := range testVerifyMembershipABICases {
		bz, err := hex.DecodeString(tc.input)
		if err != nil {
			t.Fatal(err)
		}
		proof, err := EthABIDecodeCommitmentProof(bz)
		if err != nil {
			t.Fatal(err)
		}
		bz2, err := EthABIEncodeCommitmentProof(proof)
		if err != nil {
			t.Fatal(err)
		}
		if !bytes.Equal(bz, bz2) {
			t.Fatal("pack/unpack failed")
		}
		hc, err := EthABIDecodeHeaderedProxyMessage(proof.Message)
		if err != nil {
			t.Fatal(err)
		}
		_, err = hc.GetVerifyMembershipProxyMessage()
		if err != nil {
			t.Fatal(err)
		}
	}
}

